// Default imports
import React, {Component} from 'react';
import './App.css';

// Module imports
import 'materialize-css/dist/css/materialize.css';
import 'materialize-css/dist/js/materialize'
import {BrowserRouter as Router, Route, Switch} from "react-router-dom";
import {IconContext} from "react-icons";
import axios from 'axios';

// Component imports
import Home from './components/home/home';
import About from './components/about/about';
import Portfolio from './containers/portfolio/portfolio';
import Contact from './components/contact/contact';

class App extends Component {
    // Default constructor
    constructor() {
        super();
        this.state = {
            personalData: []
        }
    }

    componentDidMount() {
        // Get data from wagtail cms here
        axios
            .get('http://localhost:8000/api/v2/pages/?type=personalinfo.personalinfo&fields=*')
            .then(data => this.setState({personalData: data.data.items[0]}))
            .catch(error => console.log(error))
    }

    render() {
        return (
            // HTML here
            <IconContext.Provider value={{style: {verticalAlign: 'middle'}, size: '24px'}}>
                <Router>
                    <div className="App">
                        <Switch>
                            <Route exact path='/'
                                   render={(routeProp) => (<Home {...routeProp} pi={this.state.personalData}/>)}/>
                            <Route exact path='/about' component={About}/>
                            <Route exact path='/portfolio' component={Portfolio}/>
                            <Route exact path='/contact' component={Contact}/>
                        </Switch>
                    </div>
                </Router>
            </IconContext.Provider>
        );
    }
}

// Default export
export default App;
